histogramDefault_id72(256, :) = sum(histogram_i255k_id72);
histogramDefault_id72(2:255, 256) = (sum(histogram_ij255_id72(:, 2:255))).';

% Set the format to longe to capture the differences in the experimental probabilities
format longe

% The experimental conditional probability values observed for the output double bytes
experimentalCondProbs_i0k_id72 = histogram_i0k_id72 ./ numberOfBytesCollectedPerI;
